import React, {Component, useState} from "react";
import {mainPageLinks} from "../../Components/Navigation_Bar/NavigationLinks";
import {Link} from "react-router-dom";
import SignUpStyles from "../LoginAndSignUpPage.module.css"

class SignUpPage extends Component {
    render() {
        return (
            <SignUp/>
        );
    }
}

const SignUp = () => {
    const [showSignUpForm, setShowSignUpForm] = useState(false);

    return (
        <div className={SignUpStyles.pageContainer}>
            <h1>Sign Up</h1>
            <h4>Already have an account? </h4>
            <Link to={mainPageLinks[4].endpoint}>
                <button>Log In</button>
            </Link>
            <div className={SignUpStyles.contentContainer}>
                <Link to={mainPageLinks[0].endpoint}>
                    <button className={SignUpStyles.closeButton}>X</button>
                </Link>
                {showSignUpForm ? <SignUpForm/> :
                    <button onClick={() => setShowSignUpForm(true)}>Sign up with email</button>}
            </div>
        </div>
    );
}

const SignUpForm = () => {
    return (
        <div>
            <form>
                <label>Email</label>
                <input type="text"/>
                <label>Password</label>
                <input type="text"/>
            </form>
            <button>Log In</button>
        </div>
    );
}

export default SignUpPage;
